@jacobandco’s Astronomia Oil Pump in action ⛽️
The watch features an oil reserve and oil well pumpjacks that are activated with the pusher at 2 o’clock. Oh, and lets top it off with that dual axis tourbillon at 6 😎

This creative horological creation is a limited edition of 88 pieces and priced at $380,000 💸
